import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

function ConfirmationPage() {
    const [bookingDetails, setBookingDetails] = useState(null);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);
    const [email, setEmail] = useState(''); // State to store email
    const [name, setName] = useState(''); // State to store name
    const navigate = useNavigate();

    const fetchBookingDetails = async (email, name) => {
        setLoading(true);
        try {
            const response = await axios.get(`http://localhost:5000/get-booking`, {
                params: { email, name }
            });
            setBookingDetails(response.data);
            setLoading(false);
        } catch (err) {
            setError('Error: Could not fetch booking details');
            setLoading(false);
        }
    };

    const handleEmailChange = (event) => {
        setEmail(event.target.value);
    };

    const handleNameChange = (event) => {
        setName(event.target.value);
    };

    const handleFetchClick = () => {
        if (email && name) {
            fetchBookingDetails(email, name);
        } else {
            setError('Please enter both email and name.');
        }
    };

    return (
        <div className="flex justify-center items-center min-h-screen bg-slate-500">
            <div className="bg-white p-8 rounded-lg shadow-md w-full max-w-2xl">
                <h2 className="text-2xl font-bold text-gray-800 mb-6">Booking Confirmation</h2>
                <div className="mb-4">
                    {/* Button to navigate to the home page */}
                    <div className="flex justify-center">
                        <button
                            onClick={() => navigate('/')}
                            className="bg-blue-600 text-white px-6 py-2 rounded-md mb-4"
                        >
                            Back to Home
                        </button>
                    </div>

                    {/* Input fields for email and name */}
                    <div className="mb-4">
                        <input
                            type="email"
                            value={email}
                            onChange={handleEmailChange}
                            placeholder="Enter Email"
                            className="border px-4 py-2 rounded-md w-full mb-2"
                        />
                        <input
                            type="text"
                            value={name}
                            onChange={handleNameChange}
                            placeholder="Enter Name"
                            className="border px-4 py-2 rounded-md w-full"
                        />
                    </div>

                    {/* Button to fetch booking details */}
                    <div className="flex justify-center">
                        <button
                            onClick={handleFetchClick}
                            className="bg-green-600 text-white px-6 py-2 rounded-md"
                        >
                            Fetch Booking Details
                        </button>
                    </div>

                    {/* Displaying error message */}
                    {error && <p className="text-red-600 text-center mt-4">{error}</p>}
                </div>

                {/* Display loading state or fetched booking details */}
                {loading && <p className="text-center text-yellow-600">Loading...</p>}

                {bookingDetails && (
                    <div className="mt-6">
                        <p className="text-lg font-semibold">Booking Details</p>
                        <div className="mb-4">
                            <p><strong>Guest Name:</strong> {bookingDetails.firstName} {bookingDetails.lastName}</p>
                            <p><strong>Email:</strong> {bookingDetails.email}</p>
                            <p><strong>Phone:</strong> {bookingDetails.phone}</p>
                            <p><strong>Date:</strong> {bookingDetails.date}</p>
                            <p><strong>Time:</strong> {bookingDetails.time}</p>
                            <p><strong>Guests:</strong> {bookingDetails.guests}</p>
                            <p><strong>Seating Preference:</strong> {bookingDetails.seatingPreference}</p>
                            <p><strong>Special Requests:</strong> {bookingDetails.specialRequests}</p>
                        </div>
                    </div>
                )}
            </div>
        </div>
    );
}

export default ConfirmationPage;
